import React, { useState } from "react";
import Purchase from "../assets/icon/purchase.svg";
import Register from "../assets/icon/register.svg";

const ProductIcon = () => {
  return (
    <footer className="flex justify-end mt-9">

      <li onclick="window.location.href='AI.html'" style={{ marginLeft: '23px' }}>
        <img className=" w-10 h-10" img src={Purchase} alt="purchase" />
        <strong>AI추천</strong>
      </li >


      <div className="btn-purchase" style={{ marginRight: '10px' }}>
        <a href="Purchase.html">
          <img src={Purchase} alt="purchase" width="50" height="50" />
        </a>
      </div>
      <div className="btn-product_registration">
        <a href="product_registration.html">
          <img src={Register} alt="register" width="50" height="50" />
        </a>
      </div>
    </footer >
  );
}

export default ProductIcon;
